(1, 'Ferry Bookings', 'BUS', 'Manager bus ticket ', 1, 'Ferry Bookings @ Jalanjalan.me', 'ferries@jalanjalan.me', '<p style=\"line-height: 15.8079996109009px;\">Hello <strong>{firstname} {lastname}</strong></p>\r\n<p style=\"line-height: 15.8079996109009px;\">Your ticket has been reserved at yourcompany.com</p>\r\n<p style=\"line-height: 15.8079996109009px;\">Your booking number is: <strong>{order_number}</strong></p>\r\n<p style=\"line-height: 15.8079996109009px;\"><span style=\"font-size: 12.1599998474121px; line-height: 15.8079996109009px;\">Sub Total: {subtotal}</span></p>\r\n<p style=\"line-height: 15.8079996109009px;\"><span style=\"font-size: 12.1599998474121px; line-height: 15.8079996109009px;\">Tax &amp; fee: </span><span style=\"font-size: 12.1599998474121px; line-height: 15.8079996109009px;\">{tax}</span></p>\r\n<p style=\"line-height: 15.8079996109009px;\">Total amount: {total}</p>\r\n<p style=\"line-height: 15.8079996109009px;\">Following information is booking detail</p>\r\n<p style=\"line-height: 15.8079996109009px;\"><strong>Passenger(s)</strong>:</p>\r\n<p style=\"line-height: 15.8079996109009px;\">{passenger}</p>\r\n<p style=\"line-height: 15.8079996109009px;\"><span style=\"text-decoration: underline;\"><strong>Route information</strong></span></p>\r\n<p style=\"line-height: 15.8079996109009px;\">{tripdetail}</p>\r\n<hr />\r\n<p style=\"line-height: 15.8079996109009px;\">You can track your booking at {order_link}</p>\r\n<p style=\"line-height: 15.8079996109009px;\">If you need any support, please call xxx-xxx xxxx</p>', 'Ticket Confirmation', 'quan@joombooking.com', '<p style=\"line-height: 15.8079996109009px;\">Hello <strong>{firstname} {lastname}</strong></p>\r\n<p style=\"line-height: 15.8079996109009px;\">Your ticket has been reserved at yourcompany.com</p>\r\n<p style=\"line-height: 15.8079996109009px;\">Your booking number is: <strong>{order_number}</strong></p>\r\n<p style=\"line-height: 15.8079996109009px;\">Total amount: {total}</p>\r\n<p style=\"line-height: 15.8079996109009px;\">Following information is booking detail</p>\r\n<p style=\"line-height: 15.8079996109009px;\"><strong>Passenger(s)</strong>:</p>\r\n<p style=\"line-height: 15.8079996109009px;\">{passenger}</p>\r\n<p style=\"line-height: 15.8079996109009px;\"><span style=\"text-decoration: underline;\"><strong>Route information</strong></span></p>\r\n<p style=\"line-height: 15.8079996109009px;\">{tripdetail}</p>\r\n<hr />\r\n<p style=\"line-height: 15.8079996109009px;\">You can track your booking at {order_link}</p>\r\n<p style=\"line-height: 15.8079996109009px;\">If you need any support, please call xxx-xxx xxxx</p>', 'New order received', '', '', '0', 0, 'bustrips;buses;agents;cgroups;seattemplates;pmibustrips;passengers;coupons;countries', '0', '1');
