(9, 162, 'Privacy Policy', 'privacy-policy', '<h1 id=\"ppHeader\">Jalanjalan.me Privacy Policy</h1>\r\n<div id=\"ppBody\">\r\n<div style=\"clear: both; height: 10px;\"> </div>\r\n<div style=\"clear: both; height: 10px;\"> </div>\r\n<div class=\"innerText\">This privacy policy has been compiled to better serve those who are concerned with how their \'Personally Identifiable Information\' (PII) is being used online. PII, as described in US privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website.</div>\r\n<span id=\"infoCo\"></span><br />\r\n<div class=\"grayText\"><strong>What personal information do we collect from the people that visit our blog, website or app?</strong></div>\r\n<br />\r\n<div class=\"innerText\">When ordering or registering on our site, as appropriate, you may be asked to enter your name, email address, phone number or other details to help you with your experience.</div>\r\n<br />\r\n<div class=\"grayText\"><strong>When do we collect information?</strong></div>\r\n<br />\r\n<div class=\"innerText\">We collect information from you when you register on our site, subscribe to a newsletter, respond to a survey, fill out a form, Open a Support Ticket or enter information on our site.</div>\r\n<br />Provide us with feedback on our products or services.</div>\r\n<div><span id=\"infoUs\"></span><br />\r\n<div class=\"grayText\"><strong>How do we use your information? </strong></div>\r\n<br />\r\n<div class=\"innerText\">We may use the information we collect from you when you register, make a purchase, sign up for our newsletter, respond to a survey or marketing communication, surf the website, or use certain other site features in the following ways:<br /><br /></div>\r\n<div class=\"innerText\">      <strong>•</strong> To personalize your experience and to allow us to deliver the type of content and product offerings in which you are most interested.</div>\r\n<div class=\"innerText\">      <strong>•</strong> To improve our website in order to better serve you.</div>\r\n<div class=\"innerText\">      <strong>•</strong> To allow us to better service you in responding to your customer service requests.</div>\r\n<div class=\"innerText\">      <strong>•</strong> To administer a contest, promotion, survey or other site feature.</div>\r\n<div class=\"innerText\">      <strong>•</strong> To ask for ratings and reviews of services or products</div>\r\n<div class=\"innerText\">      <strong>•</strong> To follow up with them after correspondence (live chat, email or phone inquiries)</div>\r\n<span id=\"infoPro\"></span><br />\r\n<div class=\"grayText\"><strong>How do we protect your information?</strong></div>\r\n<br />\r\n<div class=\"innerText\">Our website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible.<br /><br /></div>\r\n<div class=\"innerText\">We use regular Malware Scanning.<br /><br /></div>\r\n<div class=\"innerText\">Your personal information is contained behind secured networks and is only accessible by a limited number of persons who have special access rights to such systems, and are required to keep the information confidential. In addition, all sensitive/credit information you supply is encrypted via Secure Socket Layer (SSL) technology.</div>\r\n<br />\r\n<div class=\"innerText\">We implement a variety of security measures when a user places an order enters, submits, or accesses their information to maintain the safety of your personal information.</div>\r\n<br />\r\n<div class=\"innerText\">All transactions are processed through a gateway provider and are not stored or processed on our servers.</div>\r\n<span id=\"coUs\"></span><br />\r\n<div class=\"grayText\"><strong>Do we use \'cookies\'?</strong></div>\r\n<br />\r\n<div class=\"innerText\">We do not use cookies for tracking purposes</div>\r\n<div class=\"innerText\"><br />You can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser settings. Since browser is a little different, look at your browser\'s Help Menu to learn the correct way to modify your cookies.</div>\r\n<br />\r\n<div class=\"innerText\">If you turn cookies off, Some of the features that make your site experience more efficient may not function properly.that make your site experience more efficient and may not function properly.</div>\r\n<br /><span id=\"trDi\"></span><br />\r\n<div class=\"grayText\"><strong>Third-party disclosure</strong></div>\r\n<br />\r\n<div class=\"innerText\">We do not sell, trade, or otherwise transfer to outside parties your Personally Identifiable Information.</div>\r\n<span id=\"trLi\"></span><br />\r\n<div class=\"grayText\"><strong>Third-party links</strong></div>\r\n<br />\r\n<div class=\"innerText\">We do not include or offer third-party products or services on our website.</div>\r\n<span id=\"gooAd\"></span><br />\r\n<div class=\"blueText\"><strong>Google</strong></div>\r\n<br />\r\n<div class=\"innerText\">Google\'s advertising requirements can be summed up by Google\'s Advertising Principles. They are put in place to provide a positive experience for users. https://support.google.com/adwordspolicy/answer/1316548?hl=en <br /><br /></div>\r\n<div class=\"innerText\">We have not enabled Google AdSense on our site but we may do so in the future.</div>\r\n<span id=\"calOppa\"></span><br />\r\n<div class=\"blueText\"><strong>California Online Privacy Protection Act</strong></div>\r\n<br />\r\n<div class=\"innerText\">CalOPPA is the first state law in the nation to require commercial websites and online services to post a privacy policy. The law\'s reach stretches well beyond California to require any person or company in the United States (and conceivably the world) that operates websites collecting Personally Identifiable Information from California consumers to post a conspicuous privacy policy on its website stating exactly the information being collected and those individuals or companies with whom it is being shared. - See more at: http://consumercal.org/california-online-privacy-protection-act-caloppa/#sthash.0FdRbT51.dpuf</div>\r\n<div class=\"innerText\"><br /><strong>According to CalOPPA, we agree to the following:</strong></div>\r\n<div class=\"innerText\">Users can visit our site anonymously.</div>\r\n<div class=\"innerText\">Once this privacy policy is created, we will add a link to it on our home page or as a minimum, on the first significant page after entering our website.</div>\r\n<div class=\"innerText\">Our Privacy Policy link includes the word \'Privacy\' and can easily be found on the page specified above.</div>\r\n<div class=\"innerText\"><br />You will be notified of any Privacy Policy changes:</div>\r\n<div class=\"innerText\">      <strong>•</strong> On our Privacy Policy Page</div>\r\n<div class=\"innerText\">Can change your personal information:</div>\r\n<div class=\"innerText\">      <strong>•</strong> By logging in to your account</div>\r\n<div class=\"innerText\"><br /><strong>How does our site handle Do Not Track signals?</strong></div>\r\n<div class=\"innerText\">We honor Do Not Track signals and Do Not Track, plant cookies, or use advertising when a Do Not Track (DNT) browser mechanism is in place.</div>\r\n<div class=\"innerText\"><br /><strong>Does our site allow third-party behavioral tracking?</strong></div>\r\n<div class=\"innerText\">It\'s also important to note that we do not allow third-party behavioral tracking</div>\r\n<span id=\"coppAct\"></span><br />\r\n<div class=\"blueText\"><strong>COPPA (Children Online Privacy Protection Act)</strong></div>\r\n<br />\r\n<div class=\"innerText\">When it comes to the collection of personal information from children under the age of 13 years old, the Children\'s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission, United States\' consumer protection agency, enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children\'s privacy and safety online.<br /><br /></div>\r\n<div class=\"innerText\">We do not specifically market to children under the age of 13 years old.</div>\r\n<div class=\"innerText\">Do we let third-parties, including ad networks or plug-ins collect PII from children under 13?</div>\r\n<span id=\"ftcFip\"></span><br />\r\n<div class=\"blueText\"><strong>Fair Information Practices</strong></div>\r\n<br />\r\n<div class=\"innerText\">The Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information.<br /><br /></div>\r\n<div class=\"innerText\"><strong>In order to be in line with Fair Information Practices we will take the following responsive action, should a data breach occur:</strong></div>\r\n<div class=\"innerText\">We will notify you via email</div>\r\n<div class=\"innerText\">      <strong>•</strong> Within 7 business days</div>\r\n<div class=\"innerText\">We will notify the users via in-site notification</div>\r\n<div class=\"innerText\">      <strong>•</strong> Within 7 business days</div>\r\n<div class=\"innerText\"><br />We also agree to the Individual Redress Principle which requires that individuals have the right to legally pursue enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users, but also that individuals have recourse to courts or government agencies to investigate and/or prosecute non-compliance by data processors.</div>\r\n<span id=\"canSpam\"></span><br />\r\n<div class=\"blueText\"><strong>CAN SPAM Act</strong></div>\r\n<br />\r\n<div class=\"innerText\">The CAN-SPAM Act is a law that sets the rules for commercial email, establishes requirements for commercial messages, gives recipients the right to have emails stopped from being sent to them, and spells out tough penalties for violations.<br /><br /></div>\r\n<div class=\"innerText\"><strong>We collect your email address in order to:</strong></div>\r\n<div class=\"innerText\">      <strong>•</strong> Send information, respond to inquiries, and/or other requests or questions</div>\r\n<div class=\"innerText\">      <strong>•</strong> Process orders and to send information and updates pertaining to orders.</div>\r\n<div class=\"innerText\">      <strong>•</strong> Send you additional information related to your product and/or service</div>\r\n<div class=\"innerText\"><br /><strong>To be in accordance with CANSPAM, we agree to the following:</strong></div>\r\n<div class=\"innerText\">      <strong>•</strong> Not use false or misleading subjects or email addresses.</div>\r\n<div class=\"innerText\">      <strong>•</strong> Identify the message as an advertisement in some reasonable way.</div>\r\n<div class=\"innerText\">      <strong>•</strong> Include the physical address of our business or site headquarters.</div>\r\n<div class=\"innerText\">      <strong>•</strong> Monitor third-party email marketing services for compliance, if one is used.</div>\r\n<div class=\"innerText\">      <strong>•</strong> Honor opt-out/unsubscribe requests quickly.</div>\r\n<div class=\"innerText\">      <strong>•</strong> Allow users to unsubscribe by using the link at the bottom of each email.</div>\r\n<div class=\"innerText\"><strong><br />If at any time you would like to unsubscribe from receiving future emails, you can email us at</strong></div>\r\n<div class=\"innerText\">unsbscribe@goindo.me and we will promptly remove you from <strong>ALL</strong> correspondence.</div>\r\n<br /><span id=\"ourCon\"></span><br />\r\n<div class=\"blueText\"><strong>Contacting Us</strong></div>\r\n<br />\r\n<div class=\"innerText\">If there are any questions regarding this privacy policy, you may contact us using the information below.<br /><br /></div>\r\n<div class=\"innerText\"><strong>PT. Little Blue Planet Indonesia</strong></div>\r\n<div class=\"innerText\">Komplek Ruko Nagoya Block C1, No. 2, Level 2</div>\r\nKota Batam, Kepulauan Riau 29432\r\n<div class=\"innerText\">INDONESIA</div>\r\n<div class=\"innerText\">admin@goindo.me</div>\r\n<div class=\"innerText\">+62 819 3365 0803</div>\r\n<div class=\"innerText\"><br />Last Edited on 2017-11-17</div>\r\n</div>', '', 1, 2, '2017-11-17 08:39:05', 47, '', '2017-11-17 08:44:09', 47, 0, '0000-00-00 00:00:00', '2017-11-17 08:39:05', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 4, '', '', 1, 6, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(10, 165, 'About PT. Little Blue Planet Indonesia', 'about-pt-little-blue-planet-indonesia', '<h1>About PT. Little Blue Planet Indonesia</h1>\r\n<p>Goindo.me is owned by PT. Little Blue Planet Indonesia operating from its offices in Nagoya, Batam, Riau Islands. This is a foreign-owned Indonesian company owned by Cathcart Weatherly and his Australian company Origin Ideas Pty Ltd. It owns and operates a number of tourism businesses including:</p>\r\n<ul>\r\n<li>goindo.me</li>\r\n<li>jalanjalan.me</li>\r\n</ul>', '', 1, 2, '2017-11-17 14:05:50', 47, '', '2017-11-17 14:05:50', 0, 0, '0000-00-00 00:00:00', '2017-11-17 14:05:50', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 3, '', '', 1, 21, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(11, 166, 'About Jalanjalan.me', 'about-jalanjalan-me', '<h1>About Jalanjalan.me</h1>\r\n<p>JalanJalan.me is a new website offering hotels and other accommodation providers an affordable and easy-to-use online booking system.</p>\r\n<h3>Who Owns jalanjalan.me?</h3>\r\n<p>Jalanjalan.me is owned by PT. Little Blue Planet Indonesia, operating from its offices in Nagoya, Batam, Riau Islands. It is a foreign-owned Indonesian company owned by David Weatherly and his Australian company Origin Ideas Pty Ltd.</p>', '', 1, 2, '2017-11-17 14:08:55', 47, '', '2017-11-17 14:19:36', 47, 0, '0000-00-00 00:00:00', '2017-11-17 14:08:55', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 2, '', '', 1, 6, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(12, 167, 'Place Your Hotel Inventory on Jalanjalan.me', 'place-your-hotel-inventory-on-jalanjalan-me', '<h1>Place Your Hotel Inventory on Jalanjalan.me</h1>\r\n<h3>What is jalanjalan.me</h3>\r\n<p>JalanJalan.me is a new website offering hotels and other accommodation providers an affordable and easy-to-use online booking system.</p>\r\n<h3>Why Choose jalanjalan.me?</h3>\r\n<ul>\r\n<li>Easy to use, highly responsive support</li>\r\n<li>Cost effective, simple commission charge</li>\r\n<li>Full control of tariffs, range of booking options</li>\r\n<li>Four inventory placement options.</li>\r\n</ul>\r\n<h3>What Are the Inventory Placement Options?</h3>\r\n<p>We offer four inventory placement options:</p>\r\n<ul>\r\n<li>Di portal jalanjalan.me - jalanjalan.me/main/</li>\r\n<li>Sebagai SP di jalanjalan.me - subdomain property tunggal dari jalanjalan.me- misalnya jalanjalan.me/your_hotel_name</li>\r\n<li>Sebagai situs tersendiri dengan domain Supplier - misalnya: bizhotelbatam.com. Jika tidak memiliki situs web dan nama domain, akan ada biaya tambahan untuk nama domain dan web hosting</li>\r\n<li>Sebagai widget pada domain Supplier yang ada pemasangan plug-in system dan pemesanan jalanjalan.me pada domain supplier yang ada</li>\r\n</ul>\r\n<h3>What Booking Terms Can I Offer Customers?</h3>\r\n<p>You can offer your customers the following booking terms:</p>\r\n<ul>\r\n<li>Prepayment in full by credit card with no refund.</li>\r\n<li>Prepayment in full by credit card. Cancellation free of charge until 1 day before arrival after which customer will be charged all or some of the value of the booking.</li>\r\n<li>Prepayment in full by credit card. Cancellation free of charge until 1 day before arrival after which customer will be charged all or some of the value of the booking.</li>\r\n<li>Booking secured with credit card details. Prepayment made x days prior to arrival. No refund after x day prior to arrival.</li>\r\n<li>Payment on arrival at hotel. No prepayment required with booking secured with credit card details. Cancellation free of charge until 1 day before arrival after which customer will be charged all or some of the value of the booking.</li>\r\n<li>Payment on arrival at hotel with booking secured with credit card details. Cancellation free of charge until 1 day before arrival after which customer will be charged all or some of the value of the booking.</li>\r\n</ul>\r\n<h3>What Payment Gateway Do You Use?</h3>\r\n<p>We use the Xendit Payment Gateway to securely process payments. Other payment options will be implemented overtime.</p>\r\n<h3>What do you Charge?</h3>\r\n<p>We charge a commission of 8% of the value any booking made through the website. No other charges are payable.</p>\r\n<h3>When &amp; How Will I Get Paid?</h3>\r\n<p>All payments we make to you will be paid into your nominated Indonesian bank account. Money we receive for bookings at your property will be paid within 72 hours. Prior to remitting the payment to you we will take our 8% commission payment and retain the amount that may be refunded to the customer if they cancel. A remittance advice will be emails to you.</p>\r\n<h3>Where will my inventory appear on the web?</h3>\r\n<p>Depending on what you choose from the above options your property will appear on the web at:</p>\r\n<ul>\r\n<li>me/main/</li>\r\n<li>me/your_hotel_name</li>\r\n<li>Sebagai situs tersendiri dengan domain Supplier - misalnya: yourhotelname.com</li>\r\n<li>Sebagai widget pada pemasangan web situs</li>\r\n</ul>\r\n<h3>How will jalanjalan.me Be Promoted?</h3>\r\n<p>Jalanjalan.me is the booking system linked to goindo.me website and your hotel will be promoted on goindo.me free of charge. Additionally, we use deep Search Engine Optimisation is the primary method of promoting jalanjalan.me.</p>\r\n<h3>Do You Offer Any Special Offers, Promotion Campaigns and Reward Systems?</h3>\r\n<p>Yes, soon we will announce some special offers, promotions and a customer reward scheme that all our accommodation partners will be invited to take part in.</p>\r\n<h3>Is There a Minimum Contract Period?</h3>\r\n<p>No, you can cancel at any time by giving 1-month notice.</p>\r\n<h3>Who Owns jalanjalan.me?</h3>\r\n<p>Jalanjalan.me is owned by PT. Little Blue Planet Indonesia, operating from its offices in Nagoya, Batam, Riau Islands. It is a foreign-owned Indonesian company owned by David Weatherly and his Australian company Origin Ideas Pty Ltd.</p>', '', 1, 2, '2017-11-17 14:18:57', 47, '', '2017-11-17 14:18:57', 0, 0, '0000-00-00 00:00:00', '2017-11-17 14:18:57', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 1, 1, '', '', 1, 8, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '');
