INSERT INTO `q43qy_jomres_custom_text` (`uid`, `constant`, `customtext`, `property_uid`, `language`, `reserved`, `language_context`) VALUES
(249, '_JOMRES_CUSTOMTEXT_PROPERTY_NAME', 'Harmoni Hotel', 26, 'en-GB', NULL, '0'),
(250, '_JOMRES_CUSTOMTEXT_PROPERTY_STREET', 'Jl. Imam Bonjol', 26, 'en-GB', NULL, '0'),
(251, '_JOMRES_CUSTOMTEXT_PROPERTY_TOWN', 'Nagoya Batam', 26, 'en-GB', NULL, '0'),
(252, '_JOMRES_CUSTOMTEXT_ROOMTYPE_DESCRIPTION', '&#60;p&#62;Harmoni Hotel, Batam is a 263-room hotel in the city of Nagoya on the island of Batam, Indonesia. The hotel is nestled within a city with a flourishing nightlife and entertainment districts ranging from numerous pubs &#38; bars, as well as shopping street.&#60;/p&#62;&#10;&#60;p&#62;Ensconced among a group of tropical islands in the north eastern side of Indonesia is Harmoni Hotel ¿ an inexpensive, corporate hotel in the majestic island of Batam. Harmoni Hotel is the ideal hotel for business travelers looking for that perfect place to stay while in Batam.&#60;/p&#62;&#10;&#60;p&#62;Welcoming with its simple but elegant interiors, the hotel provides guests with cozy accommodations furnished with ample room amenities for their utmost convenience. With commendable facilities and a highly skilled staff, this Indonesian hotel guarantees guests of a relaxing, memorable stay.&#60;/p&#62;&#10;&#60;p&#62;Harmoni Hotel is nestled within a city with a flourishing nightlife and surrounded by white, sandy beaches with turquoise waters. It is easily accessible to the entertainment and shopping districts of Batam.&#60;/p&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Welcoming with its simple but elegant interiors, the hotel provides guests with cozy accommodations furnished with ample room amenities for their utmost convenience. With various food &#38; beverage outlets, as well as night club, bar, and boutique shops, rest assured that the hotel will be an ideal residence for the discerning travelers.&#60;/p&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Harmoni Hotel also boasts additional banquet facilities which encompass a newly constructed ballroom and numerous meeting rooms. For relaxation, massage and spa treatments are also provided at our in-house spa.&#60;/p&#62;&#10;&#60;table&#62;&#60;tr&#62;&#60;td&#62;&#10;&#60;ul&#62;&#60;li&#62;24 Hour Security&#60;/li&#62;&#10;&#60;li&#62;24-Hour Coffee Shop&#60;/li&#62;&#10;&#60;li&#62;24-hour room service&#60;/li&#62;&#10;&#60;li&#62;Air Conditioning&#60;/li&#62;&#10;&#60;li&#62;Breakfast&#60;/li&#62;&#10;&#60;li&#62;Conference facilities&#60;/li&#62;&#10;&#60;li&#62;Dry cleaning facilities&#60;/li&#62;&#10;&#60;li&#62;Guest Laundry&#60;/li&#62;&#10;&#60;li&#62;Internet access&#60;/li&#62;&#10;&#60;li&#62;Luggage Storage&#60;/li&#62;&#10;&#60;li&#62;Photocopy service&#60;/li&#62;&#10;&#60;li&#62;Porterage&#60;/li&#62;&#10;&#60;li&#62;Sauna&#60;/li&#62;&#10;&#60;/ul&#62;&#60;/td&#62;&#10;&#60;td&#62;&#10;&#60;ul&#62;&#60;li&#62;24 Hr Front Desk&#60;/li&#62;&#10;&#60;li&#62;24-hour food &#38; beverage kiosk&#60;/li&#62;&#10;&#60;li&#62;ATM/Cash machine&#60;/li&#62;&#10;&#60;li&#62;Bar/Lounge&#60;/li&#62;&#10;&#60;li&#62;Business centre&#60;/li&#62;&#10;&#60;li&#62;Currency exchange services&#60;/li&#62;&#10;&#60;li&#62;Free parking&#60;/li&#62;&#10;&#60;li&#62;Gym / Fitness Centre&#60;/li&#62;&#10;&#60;li&#62;Lifts&#60;/li&#62;&#10;&#60;li&#62;Non-smoking rooms/floors&#60;/li&#62;&#10;&#60;li&#62;Pool&#60;/li&#62;&#10;&#60;li&#62;Restaurant&#60;/li&#62;&#10;&#60;li&#62;Spa/massage&#60;/li&#62;&#10;&#60;/ul&#62;&#60;/td&#62;&#10;&#60;/tr&#62;&#60;/table&#62;&#60;p&#62; &#60;/p&#62;', 26, 'en-GB', NULL, '0'),
(253, '_JOMRES_CUSTOMTEXT_ROOMTYPE_CHECKINTIMES', '&#60;p&#62;Check-in available from 2.00pm or other times by prior arrangement&#60;/p&#62;', 26, 'en-GB', NULL, '0'),
(254, '_JOMRES_CUSTOMTEXT_ROOMTYPE_AREAACTIVITIES', '&#60;p class=&#34;font_8&#34;&#62;Shopping, golf, entertainment, KTV, touring, transit, restarants, street food.&#60;/p&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Around the Hotel:&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Nagoya Hill Shopping Complex - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Batam City Square (BCS) Mall - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Top 100 Supermart - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;McDonald&#39;s and Kentucky Fried Chicken (KFC) - beside the hotel&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Shopping Street - around the hotel vicinity&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Various Pubs &#38; Bars - around the hotel vicinity&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Masjid Raya Baitussakur - 3 minutes walk&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;/ul&#62;', 26, 'en-GB', NULL, '0'),
(255, '_JOMRES_CUSTOMTEXT_ROOMTYPE_DIRECTIONS', '&#60;p&#62;Harmoni Hotel can be found on Jl. Imam Bonjol - easily accessible from the airport and ferrie terminals.&#60;/p&#62;', 26, 'en-GB', NULL, '0'),
(256, '_JOMRES_CUSTOMTEXT_ROOMTYPE_AIRPORTS', '&#60;p&#62;Hang Nadim International Airport is a 30 minute drive from the hotel&#60;/p&#62;', 26, 'en-GB', NULL, '0'),
(257, '_JOMRES_CUSTOMTEXT_ROOMTYPE_OTHERTRANSPORT', '&#60;p&#62;Taxis and ojeks are available at the front of the hotel.&#60;/p&#62;&#10;&#60;p&#62;Ferry Terminals:&#60;/p&#62;&#10;&#60;p&#62; &#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Harbour Bay Ferry Terminal : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Batam Center Ferry Terminal : 20 minutes&#60;/li&#62;&#10;&#60;li&#62;Sekupang Ferry Terminal : 30 minutes&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62; &#60;/p&#62;', 26, 'en-GB', NULL, '0'),
(258, '_JOMRES_CUSTOMTEXT_ROOMTYPE_DISCLAIMERS', '&#60;p&#62;Requests for bed type and smoking preferences will be submitted to the hotel but are not guaranteed.&#60;/p&#62;', 26, 'en-GB', NULL, '0'),
(259, '_JOMRES_CUSTOMTEXT_PROPERTY_METATITLE', 'Harmoni Hotel Nagoya Batam', 26, 'en-GB', NULL, '0'),
(260, '_JOMRES_CUSTOMTEXT_PROPERTY_METADESCRIPTION', 'Harmoni Hotel Nagoya is a 4 star offering quality rooms at affordable prices in the heart of Nagoya Batam', 26, 'en-GB', NULL, '0'),
