(275, '_JOMRES_CUSTOMTEXT_PROPERTY_NAME', 'Biz Hotel Batam', 28, 'en-GB', '', '0'),
(276, '_JOMRES_CUSTOMTEXT_PROPERTY_STREET', 'Komplek Nagoya Newtown Blok T No.15, Jalan Kompleks Nagoya City Walk, Lubuk Baja, Kota Batam, Kepulauan Riau 29444', 28, 'en-GB', '', '0'),
(277, '_JOMRES_CUSTOMTEXT_PROPERTY_TOWN', 'Lubuk Baja', 28, 'en-GB', '', '0'),
(278, '_JOMRES_CUSTOMTEXT_ROOMTYPE_DESCRIPTION', '&#60;p&#62;Biz Hotel is a 3 stars hotel located in Nagoya Area, Batam&#39;s Central Business District. Biz Hotel is close to a wide choice of amenities for business, entertainment and leisure. Shopping malls, restaurants and nightclubs are within walking distance. With a designated integrated business area stand right next to the hotel you should have no trouble getting around the city.&#60;br /&#62;&#60;br /&#62;Book one of our 117 rooms and benefit from our amenities, three meeting rooms, three restaurants, one bar, fitness centre and current pool. &#60;br /&#62;All rooms are fully furnished. Free high-speed wi-fi internet in all around the building. Access to the guest floors is secured by keycard and all public area, including lobby and elevators are secured by CCTV.&#60;br /&#62;&#60;br /&#62;If you are looking for an excellent hotel that can give you great value with reasonable room rates, then Biz Hotel is the perfect answer for all your needs because we care.&#60;/p&#62;&#10;&#60;p&#62;&#60;strong&#62;Walking Distances and Nearby or Next Door to :&#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Nagoya Citywalk and DC Mall Shopping Center&#60;/li&#62;&#10;&#60;li&#62;Nagoya Hills Shopping mall&#60;/li&#62;&#10;&#60;li&#62;Lucky Plaza Shopping Center (Gadget Center)&#60;/li&#62;&#10;&#60;li&#62;Bumi Indah Shopping Center&#60;/li&#62;&#10;&#60;li&#62;Foodcourt District A1 Nagoya&#60;/li&#62;&#10;&#60;li&#62;Foodcourt Utama&#60;/li&#62;&#10;&#60;li&#62;BCS Mall Penuin&#60;/li&#62;&#10;&#60;li&#62;Top 100 Penuin&#60;/li&#62;&#10;&#60;li&#62;Entertainment and Nightlife district&#60;/li&#62;&#10;&#60;li&#62;Kampung Bule&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62;&#60;strong&#62;Other Accessibility – Airport and Ferry Port: &#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Hang Nadim Airport : 40 minutes&#60;/li&#62;&#10;&#60;li&#62;Harbour Bay Ferry Terminal : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Batam Center Ferry Terminal : 20 minutes&#60;/li&#62;&#10;&#60;li&#62;Sekupang Ferry Terminal : 30 minutes&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62;&#60;strong&#62;Other Accessibility - Golf Course :&#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Padang Golf Sukajadi : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Southlink Golf Course : 15 minutes&#60;/li&#62;&#10;&#60;li&#62;Indah Puri Golf Course : 30 minutes&#60;/li&#62;&#10;&#60;li&#62;Palm Spring Golf Course : 45 minutes&#60;br /&#62;&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62;&#60;strong&#62;Other Accessibility – Industrial Parks :&#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Batu Ampar Industrial Park : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Muka Kuning &#38; Panbil Industrial Park : 15 minutes&#60;/li&#62;&#10;&#60;li&#62;Tg. Uncang Industrial Park : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Kabil Industrial Park : 45 minutes&#60;/li&#62;&#10;&#60;/ul&#62;', 28, 'en-GB', '', '0'),
