(26, 'Harmoni Hotel', 'Jl. Imam Bonjol', 'Nagoya Batam', '3933', 'ID', '29453', '+62 778 459 308', '+62 778 459 306', 'info.hhbtm@harmonigroup.biz', ',32,7,9,10,48,33,19,21,23,25,29,30,6,37,40,42,49,4,54,61,22,67,68,63,74,8,75,77,47,', '', '&#60;p&#62;Harmoni Hotel, Batam is a 263-room hotel in the city of Nagoya on the island of Batam, Indonesia. The hotel is nestled within a city with a flourishing nightlife and entertainment districts ranging from numerous pubs &#38; bars, as well as shopping street.&#60;/p&#62;&#10;&#60;p&#62;Ensconced among a group of tropical islands in the north eastern side of Indonesia is Harmoni Hotel ¿ an inexpensive, corporate hotel in the majestic island of Batam. Harmoni Hotel is the ideal hotel for business travelers looking for that perfect place to stay while in Batam.&#60;/p&#62;&#10;&#60;p&#62;Welcoming with its simple but elegant interiors, the hotel provides guests with cozy accommodations furnished with ample room amenities for their utmost convenience. With commendable facilities and a highly skilled staff, this Indonesian hotel guarantees guests of a relaxing, memorable stay.&#60;/p&#62;&#10;&#60;p&#62;Harmoni Hotel is nestled within a city with a flourishing nightlife and surrounded by white, sandy beaches with turquoise waters. It is easily accessible to the entertainment and shopping districts of Batam.&#60;/p&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Welcoming with its simple but elegant interiors, the hotel provides guests with cozy accommodations furnished with ample room amenities for their utmost convenience. With various food &#38; beverage outlets, as well as night club, bar, and boutique shops, rest assured that the hotel will be an ideal residence for the discerning travelers.&#60;/p&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Harmoni Hotel also boasts additional banquet facilities which encompass a newly constructed ballroom and numerous meeting rooms. For relaxation, massage and spa treatments are also provided at our in-house spa.&#60;/p&#62;&#10;&#60;table&#62;&#60;tr&#62;&#60;td&#62;&#10;&#60;ul&#62;&#60;li&#62;24 Hour Security&#60;/li&#62;&#10;&#60;li&#62;24-Hour Coffee Shop&#60;/li&#62;&#10;&#60;li&#62;24-hour room service&#60;/li&#62;&#10;&#60;li&#62;Air Conditioning&#60;/li&#62;&#10;&#60;li&#62;Breakfast&#60;/li&#62;&#10;&#60;li&#62;Conference facilities&#60;/li&#62;&#10;&#60;li&#62;Dry cleaning facilities&#60;/li&#62;&#10;&#60;li&#62;Guest Laundry&#60;/li&#62;&#10;&#60;li&#62;Internet access&#60;/li&#62;&#10;&#60;li&#62;Luggage Storage&#60;/li&#62;&#10;&#60;li&#62;Photocopy service&#60;/li&#62;&#10;&#60;li&#62;Porterage&#60;/li&#62;&#10;&#60;li&#62;Sauna&#60;/li&#62;&#10;&#60;/ul&#62;&#60;/td&#62;&#10;&#60;td&#62;&#10;&#60;ul&#62;&#60;li&#62;24 Hr Front Desk&#60;/li&#62;&#10;&#60;li&#62;24-hour food &#38; beverage kiosk&#60;/li&#62;&#10;&#60;li&#62;ATM/Cash machine&#60;/li&#62;&#10;&#60;li&#62;Bar/Lounge&#60;/li&#62;&#10;&#60;li&#62;Business centre&#60;/li&#62;&#10;&#60;li&#62;Currency exchange services&#60;/li&#62;&#10;&#60;li&#62;Free parking&#60;/li&#62;&#10;&#60;li&#62;Gym / Fitness Centre&#60;/li&#62;&#10;&#60;li&#62;Lifts&#60;/li&#62;&#10;&#60;li&#62;Non-smoking rooms/floors&#60;/li&#62;&#10;&#60;li&#62;Pool&#60;/li&#62;&#10;&#60;li&#62;Restaurant&#60;/li&#62;&#10;&#60;li&#62;Spa/massage&#60;/li&#62;&#10;&#60;/ul&#62;&#60;/td&#62;&#10;&#60;/tr&#62;&#60;/table&#62;&#60;p&#62; &#60;/p&#62;', '&#60;p&#62;Check-in available from 2.00pm or other times by prior arrangement&#60;/p&#62;', '&#60;p class=&#34;font_8&#34;&#62;Shopping, golf, entertainment, KTV, touring, transit, restarants, street food.&#60;/p&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Around the Hotel:&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Nagoya Hill Shopping Complex - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Batam City Square (BCS) Mall - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Top 100 Supermart - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;McDonald&#39;s and Kentucky Fried Chicken (KFC) - beside the hotel&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Shopping Street - around the hotel vicinity&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Various Pubs &#38; Bars - around the hotel vicinity&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Masjid Raya Baitussakur - 3 minutes walk&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;/ul&#62;', '&#60;p&#62;Harmoni Hotel can be found on Jl. Imam Bonjol - easily accessible from the airport and ferrie terminals.&#60;/p&#62;', '&#60;p&#62;Hang Nadim International Airport is a 30 minute drive from the hotel&#60;/p&#62;', '&#60;p&#62;Taxis and ojeks are available at the front of the hotel.&#60;/p&#62;&#10;&#60;p&#62;Ferry Terminals:&#60;/p&#62;&#10;&#60;p&#62; &#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Harbour Bay Ferry Terminal : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Batam Center Ferry Terminal : 20 minutes&#60;/li&#62;&#10;&#60;li&#62;Sekupang Ferry Terminal : 30 minutes&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62; &#60;/p&#62;', '&#60;p&#62;Requests for bed type and smoking preferences will be submitted to the hotel but are not guaranteed.&#60;/p&#62;', '0', 1, 4, 1, 1, 'WUnmNTfYNBkYIJUIHJZrOOMrsIXIRVTvcPTJUZlKtlCJYufDji', '1.1497957', '104.0077378', 'Harmoni Hotel Nagoya Batam', 'Harmoni Hotel Nagoya is a 4 star offering quality rooms at affordable prices in the heart of Nagoya Batam', 'hotel, 4 star hotel, 4 star, accommodation, batam, nagoya, indonesia, beds, sleep, shopping, entertainment, events, promotion', NULL, 1, '', '2017-11-07 19:47:16', '', 1, 1),
(28, 'Biz Hotel Batam', 'Komplek Nagoya Newtown Blok T No.15, Jalan Kompleks Nagoya City Walk, Lubuk Baja, Kota Batam, Kepulauan Riau 29444', 'Lubuk Baja', '3933', 'ID', '29444', '+62 778 432999', '', 'reservation@bizhotelbatam.com', ',32,7,9,10,48,33,19,23,30,6,37,40,42,49,54,61,22,67,68,63,74,8,75,77,47,', '', '&#60;p&#62;Biz Hotel is a 3 stars hotel located in Nagoya Area, Batam&#39;s Central Business District. Biz Hotel is close to a wide choice of amenities for business, entertainment and leisure. Shopping malls, restaurants and nightclubs are within walking distance. With a designated integrated business area stand right next to the hotel you should have no trouble getting around the city.&#60;br /&#62;&#60;br /&#62;Book one of our 117 rooms and benefit from our amenities, three meeting rooms, three restaurants, one bar, fitness centre and current pool. &#60;br /&#62;All rooms are fully furnished. Free high-speed wi-fi internet in all around the building. Access to the guest floors is secured by keycard and all public area, including lobby and elevators are secured by CCTV.&#60;br /&#62;&#60;br /&#62;If you are looking for an excellent hotel that can give you great value with reasonable room rates, then Biz Hotel is the perfect answer for all your needs because we care.&#60;/p&#62;&#10;&#60;p&#62;&#60;strong&#62;Walking Distances and Nearby or Next Door to :&#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Nagoya Citywalk and DC Mall Shopping Center&#60;/li&#62;&#10;&#60;li&#62;Nagoya Hills Shopping mall&#60;/li&#62;&#10;&#60;li&#62;Lucky Plaza Shopping Center (Gadget Center)&#60;/li&#62;&#10;&#60;li&#62;Bumi Indah Shopping Center&#60;/li&#62;&#10;&#60;li&#62;Foodcourt District A1 Nagoya&#60;/li&#62;&#10;&#60;li&#62;Foodcourt Utama&#60;/li&#62;&#10;&#60;li&#62;BCS Mall Penuin&#60;/li&#62;&#10;&#60;li&#62;Top 100 Penuin&#60;/li&#62;&#10;&#60;li&#62;Entertainment and Nightlife district&#60;/li&#62;&#10;&#60;li&#62;Kampung Bule&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62;&#60;strong&#62;Other Accessibility – Airport and Ferry Port: &#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Hang Nadim Airport : 40 minutes&#60;/li&#62;&#10;&#60;li&#62;Harbour Bay Ferry Terminal : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Batam Center Ferry Terminal : 20 minutes&#60;/li&#62;&#10;&#60;li&#62;Sekupang Ferry Terminal : 30 minutes&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62;&#60;strong&#62;Other Accessibility - Golf Course :&#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Padang Golf Sukajadi : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Southlink Golf Course : 15 minutes&#60;/li&#62;&#10;&#60;li&#62;Indah Puri Golf Course : 30 minutes&#60;/li&#62;&#10;&#60;li&#62;Palm Spring Golf Course : 45 minutes&#60;br /&#62;&#60;/li&#62;&#10;&#60;/ul&#62;&#60;p&#62;&#60;strong&#62;Other Accessibility – Industrial Parks :&#60;/strong&#62;&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;Batu Ampar Industrial Park : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Muka Kuning &#38; Panbil Industrial Park : 15 minutes&#60;/li&#62;&#10;&#60;li&#62;Tg. Uncang Industrial Park : 10 minutes&#60;/li&#62;&#10;&#60;li&#62;Kabil Industrial Park : 45 minutes&#60;/li&#62;&#10;&#60;/ul&#62;', '&#60;p&#62;Check-in available from 2.00pm or other times by prior arrangement&#60;/p&#62;', '&#60;p class=&#34;font_8&#34;&#62;Shopping, golf, entertainment, KTV, touring, transit, restarants, street food.&#60;/p&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Around the Hotel:&#60;/p&#62;&#10;&#60;ul&#62;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Nagoya Hill Shopping Complex - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Batam City Square (BCS) Mall - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Top 100 Supermart - 10 minutes drive&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;McDonald&#39;s and Kentucky Fried Chicken (KFC) - beside the hotel&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Shopping Street - around the hotel vicinity&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Various Pubs &#38; Bars - around the hotel vicinity&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;li&#62;&#10;&#60;p class=&#34;font_8&#34;&#62;Masjid Raya Baitussakur - 15 minutes walk&#60;/p&#62;&#10;&#60;/li&#62;&#10;&#60;/ul&#62;', '&#60;p&#62;Biz Hotel can be found on Nagoya City Walk - easily accessible from the airport and ferry terminals.&#60;/p&#62;', '&#60;p&#62;Hang Nadim International Airport is a 30 minute drive from the hotel&#60;/p&#62;', '&#60;p&#62;Taxis and ojeks are available at the front of the hotel.&#60;/p&#62;&#10;&#60;p&#62;Ferry Terminals:&#60;/p&#62;&#10;&#60;p&#62; - Harbour Bay Ferry Terminal : 10 minutes&#60;/p&#62;&#10;&#60;p&#62;- Batam Center Ferry Terminal : 20 minutes&#60;/p&#62;&#10;&#60;p&#62;- Sekupang Ferry Terminal : 30 minutes&#60;/p&#62;&#10;&#60;p&#62; &#60;/p&#62;', '&#60;p&#62;Requests for bed type and smoking preferences will be submitted to the hotel but are not guaranteed.&#60;/p&#62;', '0', 1, 3, 1, 1, 'fBnnUPqgcYoHQBxZCIJtSWqnIQYYJujhobAPqVocHaMGYrzafW', '1.1422949', '104.0064709', 'Biz Hotel Nagoya Batam', 'Biz Hotel Nagoya is a 3 star offering quality rooms at affordable prices in the heart of Nagoya Batam', 'biz, biz hotel batam, hotel, 4 star hotel, 4 star, accommodation, batam, nagoya, indonesia, beds, sleep, shopping, entertainment, events, promotion', NULL, 1, '', '2017-11-08 22:39:15', '', 1, 1);
